import React, { Component } from 'react';

export default class Head extends Component {
    render() {
        return (
            <div id="head">
                <div id="nav">
                    <ul>
                        <li><a href="/learn">learn</a></li>
                        <li><a href="/test">test</a></li>
                        <li><a href="/teacher">teachers</a></li>
                        <li><a href="/student">students</a></li>
                    </ul>
                </div>
            </div>
        );
    }
}
